import './App.css';
import {useEffect, useState} from "react";
import Navibar from "./componetns/navbar";
import {Loader} from "./componetns/loader"





function App() {

    const [loading, setLoading] = useState(false);

    useEffect(() => {
        setLoading(true)
        setTimeout(() =>{
            setLoading(false)
        }, 3000)
    }, [])

  return (
    <div className="App">
        {
        loading ?
            <Loader/>
        :

            <header>
            <Navibar/>
            <IphonePar/>
            <TextBox/>
            <MacPar/>
            <TextBox/>
            <AirPodsPar/>
            </header>

        }



    </div>
  );
}

export default App;
